import React, { Component } from 'react';
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBIcon } from 'mdbreact';
import './register.css'
import { connect } from 'react-redux'
import { Redirect } from 'react-router-dom'

class TopNavigation extends Component {

    constructor(props) {
        super(props);
        this.deconnection = this.deconnection.bind(this)
        this.renderRedirect = this.renderRedirect.bind(this)
    }
    state = {
        collapse: true
    }

    renderRedirect = () => {
        if (localStorage.getItem('login') == 'false') {
            return <Redirect to='/login' />
        } else {
            console.log('test');
        }
    }

    deconnection(e) {
        console.log('local deconnection: ', localStorage.getItem('login'));
        const action = { type: "DECONNECT", value: e }
        this.props.dispatch(action)
    }

    onClick = () => {
        this.setState({
            collapse: !this.state.collapse,
        });
    }

    toggle = () => {
        this.setState({
            dropdownOpen: !this.state.dropdownOpen
        });
    }

    render() {
        return (
            <MDBNavbar id="MDBNavbar" className="flexible-navbar  position-fixed" light expand="md" scrolling>
                <MDBNavbarBrand>
                    {this.renderRedirect()}
                </MDBNavbarBrand>
                <MDBNavbarToggler onClick={this.onClick} />
                <MDBCollapse isOpen={this.state.collapse} navbar>
                    <MDBNavbarNav left>
                        <MDBNavItem>
                            <strong className="nav-link navbar-link nom-user">Bonjour {localStorage.getItem('user')}</strong>
                        </MDBNavItem>


                        <a href="#!" className="logo-wrapper waves-effect">
                            <img alt="MDB React Logo" className="img-fluid" src={logo} />
                        </a>

                        <MDBListGroup className="list-group-flush" id="lien-dasboard-total">
                            <NavLink id="lien-dasboard" to="/admin/monProfil" >
                                <MDBListGroupItem id='MDBListGroup'>
                                    <MDBIcon icon="user" className="mr-3" />
                                    Mon Profil
                    </MDBListGroupItem>
                            </NavLink>

                            <NavLink id="lien-dasboard" exact={true} to="/admin/upload">
                                <MDBListGroupItem id='MDBListGroup'>
                                    <MDBIcon icon="download" className="mr-3" />
                                    Ajouter Article
                    </MDBListGroupItem>
                            </NavLink>

                            <NavLink id="lien-dasboard" to="/admin/article" >
                                <MDBListGroupItem id='MDBListGroup'>
                                    <MDBIcon icon="clipboard-list" className="mr-3" />
                                    Liste des Articles
                    </MDBListGroupItem>
                            </NavLink>

                            <NavLink id="lien-dasboard" to="/" >
                                <MDBListGroupItem id='MDBListGroup'>
                                    <MDBIcon icon="home" className="mr-3" />
                                    Accueil ExtraComm
                    </MDBListGroupItem>
                            </NavLink>
                            <NavLink id="lien-dasboard" to="/login" >
                                <MDBListGroupItem id='MDBListGroup' onClick={() => { this.deconnection() }}>
                                    <MDBIcon icon="home" className="mr-3" />
                                    Deconnexion
                    </MDBListGroupItem>
                            </NavLink>
                        </MDBListGroup>


                    </MDBNavbarNav>
                    <MDBNavbarNav right>
                        <MDBNavItem onClick={() => { this.deconnection() }}>
                            <MDBNavLink rel="noopener noreferrer" className="nav-link Ripple-parent" href="/login">Deconnexion</MDBNavLink>
                        </MDBNavItem>
                        <MDBNavItem>
                            <a className="nav-link navbar-link" rel="noopener noreferrer" href="https://pl-pl.facebook.com/mdbootstrap/"><MDBIcon fab icon="facebook" /></a>
                        </MDBNavItem>
                        <MDBNavItem>
                            <a className="nav-link navbar-link" rel="noopener noreferrer" href="https://twitter.com/mdbootstrap"><MDBIcon fab icon="twitter" /></a>
                        </MDBNavItem>
                    </MDBNavbarNav>
                </MDBCollapse>
            </MDBNavbar>
        );
    }
}
const mapStateToProps = (state) => {
    return {
        client: state
    }
}
export default connect(mapStateToProps)(TopNavigation);
